#chartPopup {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  width: 120px;
  height: 45px;
  margin-left: -60px;
  margin-top: 30px;
  padding: 10px 5px;
  display: none;
  text-align: center;
}
#chartTitle {
  height: 20px;
  font-size: 1.2em;
  font-weight: bold;
}
#chartTime {
  font-weight: bold;
  font-size: 0.8em;
  margin-bottom: 5px;
}

#chartValue {
  font-size: 0.9em;
}

code.content:
module = {};
module.exports = plotdb.chart.create({
  sample:  ["雲林縣", "桃園縣", "台東縣", "台北縣", "台北市", "台南縣", "台南市", "台中縣", "台中市", "屏東縣", "南投縣", "苗栗縣", "基隆市", "高雄縣", "高雄市", "宜蘭縣", "花蓮縣", "新竹縣", "新竹市", "嘉義縣", "嘉義市", "彰化縣", "連江縣", "澎湖縣", "金門縣"].map(function(it) {
    return {"縣市名": it, "數值": Math.random() * 100};
  }),
  dimension: {
    "數值": { type: [plotdb.Number], require: true, desc: "該縣市的數值" },
    "縣市名": { type: [], require: false, desc: "縣市的名字，用來對應地圖" }
  },
  config: {
    padding: { type: [plotdb.Number], default: 10, rebindOnChange: true },
    emptyColor: { type: [plotdb.Color], default: "#000", rebindOnChange: false},
    baseColor: { type: [plotdb.Color], default: "#48b", rebindOnChange: false},
    strokeColor: { type: [plotdb.Color], default: "#444", rebindOnChange: false}
  },
  init: function() {
    this.svg = d3.select(this.root).append("svg").attr({
      width: "100%", height: "100%",
      viewBox: "0 0 800 600",
      preserveAspectRatio: "xMidYMid"
    });
  },
  bind: function() {
    var that = this;
    this.countyfile = this.assets["twCounty2010.topo.json"];
    this.path = d3.geo.path().projection(
      function(coord) {
        if(coord[1]>25.5) coord[1] = coord[1] - 1;
        if(coord[0]<119) coord[0] = coord[0] + 1.2;
        return d3.geo.mercator().center([121,24]).scale(6000)(coord);
      }
    );
    for(var idx = 0; idx < this.data.length; idx++ ) {
      var item = this.data[idx];
      item["縣市名"] = item["縣市名"].replace(/臺/g, "台").substring(0,3); 
    }
    var countymap = d3.nest().key(function(it) { return it["縣市名"]; }).entries(this.data);
    for(var idx = 0; idx < countymap.length; idx++ ) {
      countymap[idx].value = d3.mean(countymap[idx].values.map(function(it) { return parseInt(it["數值"]); }));
    }
    this.data = countymap.map(function(it) { return {"縣市名": it.key, "數值": it.value};});
    d3.json(this.countyfile.datauri, function(ret) {
      var features = topojson.feature(ret, ret.objects.layer1).features;
      that.counties = features;
      for(var idx = 0; idx < features.length ; idx++) {
        matched = that.data.filter(function(it) {
          return it["縣市名"] == features[idx].properties.COUNTYNAME;
        })[0];
        if(matched) {
          features[idx].properties.value = matched["數值"];
        }
      }
      that.valueRange = features.map(function(it) { return it.properties.value; });
      that.cscale = d3.scale.linear()
        .domain(d3.extent(that.valueRange))
        .range(["#999",that.config.baseColor])
      d3.select("svg").selectAll("path.county").data(features)
        .enter().append("path").attr({class: "county"})
        .on("mousemove",function(it) {
          var x = d3.event.clientX;
          var y = d3.event.clientY;
          d3.select("#chartTitle").text(it.properties.COUNTYNAME);
          d3.select("#chartValue").text(
            (it.properties.value == undefined ? "無數值"
             :parseInt(it.properties.value*100)/100)
          );
          d3.select("#chartPopup").style({
            display: "block",
            top: y + "px",
            left: x + "px"
          });
          if(that.hidePopup) clearTimeout(that.hidePopup);
        }).on("mouseout",function(it) {
          if(that.hidePopup) clearTimeout(that.hidePopup);
          that.hidePopup = setTimeout(function() {
            d3.select("#chartPopup").style({
              display: "none"
            });
          },1000);
        });
      that.render();
    });
  },
  resize: function() {
    if(this.valueRange) {
      this.cscale = d3.scale.linear()
        .domain(d3.extent(this.valueRange))
        .range(["#999",this.config.baseColor]);
    }
  },
  render: function() {
    var that = this;
    this.svg.selectAll("path.county")
      .attr({
        "d": that.path,
        "fill": function(it) {
          var v = it.properties.value;
          if(!v) return that.config.emptyColor;
          return that.cscale(v);
        },
        "stroke": function(it) {
          if(!it.properties.value) return that.config.emptyColor;
          return that.config.strokeColor;
        },
        opacity: function(it) {
          if(!it.properties.value) return 0.2;
          return 1;
        },
        "stroke-width": 2
      });
  }
});
